import React, { Component } from 'react'
import Welcome from './welcome'

class UserGreeting extends Component {
    constructor(props) {
      super(props)
    
      this.state = {
         isLoggedIn: false
      }
    }
    
  render() {
    if(this.state.isLoggedIn){
        return(
            <div>welcome joras</div>
        )
    }else{
        return(
            <div>welcome guest</div>
        )
    }
    return (
      <div>
       <div>welcome joras</div> 
       <div>welcome guest</div>
      </div>
    )
  }
}

export default UserGreeting
